import React from 'react';

const Home = () => {
    return (
        <>
        <h1>Howdy!</h1>
        <h3>Welcome to <b>Lost then Found</b>, a digital space to find your stuff.</h3>
        <li>
            Check out the <b>Lost</b> tab to see items that people have misplaced.
        </li>
        </>
    );
}

export default Home;
